    false,nt"url": null,nt"notes": "Polygon Esri shapefile of designated areas
    for 8-hour ozone, for the revoked primary and secondary 1997 National Ambient Air
    Quality Standards (NAAQS). Nonattainment areas are geographic areas which have not
    met the 1997 NAAQS for 8-hour Ozone air pollution. Areas designated as "Attainment"
    are areas which formerly violated the NAAQS, but are now attaining. These standards
    are part of the Clean Air Act. More detailed information about NAAQS can be found
    at http://www.epa.gov/ttn/naaqs/. See Code of Federal Regulations, Section 40 Part
    81, for detailed information about designated area boundaries.",nt"license_title":
